import React from 'react';
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';

const Login = (props) => {
    
    return (
        <div>
            <Modal isOpen='true'>
                <ModalHeader>
                    <Button color='info'>Login</Button>
                    <ModalBody>
                        <Button style={{display:'block', marginLeft: 'auto', marginRight: 'auto'}} color='primary'>Login with Facebook</Button>
                        <span className='line'></span>
                    </ModalBody>
                </ModalHeader>
            </Modal>
        </div>
    );
}

export default Login;
